import React from 'react'
import { useNavigate } from 'react-router-dom';

const Header = () => {
    return (
        <header>
            <>
                <Nav>
                    <NavLink onClick={() => {
                        navigate('/')
                    }}>
                        <span>Julian van Beek</span>
                        <span>Web Designer</span>
                    </NavLink>
                    <Bars>

                    </Bars>
                    <NavMenu>
                        <NavLink onClick={() => {
                            navigate('/')
                        }}>
                            Home
                        </NavLink>
                        <NavLink onClick={() => {
                            navigate('/portfolio')
                        }}>
                            Portfolio
                        </NavLink>
                        <NavLink onClick={() => {
                            navigate('/about')
                        }}>
                            About
                        </NavLink>
                        <NavLink onClick={() => {
                            navigate('/contact')
                        }}>
                            Contact
                        </NavLink>
                    </NavMenu>
                </Nav>
            </>
        </header>
    );
}

export default Header;
